import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithubSquare, faTwitterSquare } from '@fortawesome/free-brands-svg-icons';
import { faSearch } from '@fortawesome/free-solid-svg-icons';


export default class ContactMe extends React.Component{
    render(){
        return(
            <div>
                <h1>s1280219@u-aizu.ac.jp</h1>
                <a href="https://github.com/kaki-m">
                <FontAwesomeIcon
                color="#333"
                icon={faGithubSquare} />
                </a>
                <a href="https://twitter.com/kaki">
                <FontAwesomeIcon
                color="#3eaded"
                icon={faTwitterSquare} />
                </a>
                <a href="https://qiita.com/kaki">
                <FontAwesomeIcon
                color="white"
                style={{
                overflow: 'hidden',
                height: '0.9em',
                width: '0.9em',
                backgroundColor: '#4cb10d',
                borderRadius: '2px',
                marginTop: '2px',
                }}
                icon={faSearch} />
                </a>
            </div>
        );
    }
}
